import React, {Component, useState} from 'react';
import { StyleSheet, Text, View, Image, Button, Alert } from 'react-native';
//import Moisture from './components/Moisture';

export default function App() {
  let titles={
    moisture:'Moisture', 
    humidity: 'Humidity', 
    temperature:'Temperature'
  };

  let mainImg = {
    uri: 'https://fontmeme.com/temporary/760ffcebb679896e3b0f872f59338cb2.png'
  };

  function getMoisture() {
    fetch('http://ec2-52-14-234-1.us-east-2.compute.amazonaws.com/moisture', {
        method: 'GET'
    })
    .then((response) => response.json())
    .then((responseJson) => {
        console.log(responseJson)
        Alert.alert(
            "Moisture", 
            JSON.stringify(responseJson),
            [
                { text: 'OK'}
            ]
        )
    })
    .catch((error) => {
        console.error(error);
    })
  }

  const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#EEEEEE',
      alignItems: 'center',
      justifyContent: 'center',
    },

    image: {
      width: 350, 
      height: 300,
      resizeMode: 'contain',
    },

    button: {
      flexDirection: 'row',
    },

    buttonSplit: {
      padding: 10,
    }
  });

  return (
    <View style={styles.container}>
      <Image source={require('./assets/main.png')} style={styles.image}/>
      <View style={styles.button}>
        <View style={styles.buttonSplit}>
          <Button title={titles.moisture} color='#286e23' onPress={()=>getMoisture()}/>
        </View>
        <View style={styles.buttonSplit}>
          <Button title={titles.humidity} color='#286e23' onPress={()=>null}/>
        </View>
        <View style={styles.buttonSplit}>
          <Button title={titles.temperature} color='#286e23' onPress={()=>null}/>
        </View>
      </View>
    </View>
  );
}
